import React from "react";
import "../css/modal.css";

const Modal = (props, { closeModal }) => {
  return (
    <>
      <div className="container-fluid background-img d-flex align-items-center justify-content-center">
        <div className="container w-50 p-4 my-5 text-center modal-box">
          <div
            className="btn btn-danger fw-bolder close-btn"
            onClick={(closeModal = false)}
          >
            x
          </div>
          <div className="row">
            <h1>{props.title}</h1>
          </div>
          <div className="row">
            <p>{props.content}</p>
          </div>
        </div>
      </div>
    </>
  );
};

export default Modal;
